rows = full.strip().splitlines()
rows = ['.' + row + '.' for row in rows]
empty = '.' * len(rows[0])
rows = [empty] + rows + [empty]
#for row in rows:
#    print(row)

count = 0
for y, row in enumerate(rows[1:-1], start=1):
    for x, c in enumerate(row[1:-1], start=1):
        if c == '@':
            ns = rows[y][x - 1] + rows[y][x + 1] + rows[y - 1][x - 1 : x + 2] + rows[y + 1][x - 1 : x + 2]
            if ns.count('@') < 4:
                count += 1
                print(f'{y=} {x=}')
print(count)
